    B.Map_Xp1IA = new A.ConstantStringMap(2, {jp: "20 \u300c\u5c11\u3057\u8a70\u3081\u3066\u3044\u305f\u3060\u3051\u307e\u305b\u3093\u304b\uff1f\u300d\u300c\u3042\u3001\u3054\u3081\u3093\u306a\u3055\u3044\u3002\u3053\u3093\u306a\u306b \u5834\u6240\u3092\u53d6\u3063\u3066\u3044\u305f\u306a\u3093\u3066\u6c17\u4ed8\u304d\u307e\u305b\u3093\u3067\u3057\u305f\uff61\u300d", en: '20 "Could you move over a little?" "Oh, sorry. I didn\'t realize I was taking up so much space."'}, B.List_jp_en, type$.ConstantStringMap_String_String);
