    B.List_GAW = A._setArrayType(makeConstList(["101", "102", "103", "104", "105", "106", "107", "108", "109", "110", "111", "112", "113"]), type$.JSArray_String);
    B.Map_Xp0Ri = new A.ConstantStringMap(2, {jp: "101 \u3046\u3061\u306e\u5149\u71b1\u8cbb\u304c\u305d\u3093\u306a\u984d\u306b\u306a\u3063\u3066\u3044\u308b\u306e\u3092\u77e5\u3063\u3066\u3073\u3063\u304f\u308a\u3057\u305f\u3002", en: "101 I was amazed to see that our utility bills came to so much"}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpbDN = new A.ConstantStringMap(2, {jp: "102 \uff62\u6c34\u9053\u306e\u6813\u3092\u9589\u3081\u306a\u3055\u3044\uff01\uff63\u3068\u304a\u6bcd\u3055\u3093\u304c\u304b\u3093\u304b\u3093\u306b\u306a\u3063\u3066\u53eb\u3093\u3060\u3002", en: '102 "Turn the faucet off!" mom yelled in a rage.'}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpWkW = new A.ConstantStringMap(2, {jp: "103 \u98df\u3079\u7269\u304c\u8150\u3089\u306a\u3044\u69d8\u306b\u3075\u305f\u3092\u3057\u3063\u304b\u308a\u9589\u3081\u306a\u3055\u3044\u3002", en: "103 Tighten the lid so the food doesn't go bad."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_Xphoz = new A.ConstantStringMap(2, {jp: "104 \uff62\u30cf\u30b5\u30df\u3092\u8cb8\u3057\u3066\u3082\u3089\u3048\u308b\uff1f\u300d\u300c\u3082\u3061\u308d\u3093\u3002\u306f\u3044\u3069\u3046\u305e\uff61\u300d", en: '104 "Can I borrow your scissors?" "Sure, here you are."'}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_Xp8sI = new A.ConstantStringMap(2, {jp: "105 \u91dd\u3068\u7cf8\u306e\u4ee3\u308f\u308a\u306b\u900f\u660e\u306a\u63a5\u7740\u5264\u3092\u4f7f\u3063\u3066\u3082\u7d50\u69cb\u3067\u3059\uff61", en: "105 You can substitute some transparent glue for a needle and thread."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_Xpwsa0 = new A.ConstantStringMap(2, {jp: "106 \u3053\u306e\u7e54\u7269\u3092\u67d3\u3081\u305f\u3089\u7e2e\u3093\u3067\u3057\u307e\u3063\u305f\u3002", en: "106 I dyed this fabric and it shrank"}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpsEs = new A.ConstantStringMap(2, {jp: "107 \u3053\u306e\u9769\u306e\u30b8\u30e3\u30b1\u30c3\u30c8\u306f\u51e6\u5206\u3059\u308b\u3088\u3002\u4e21\u8098\u306e\u90e8\u5206\u304c\u3059\u308a\u6e1b\u3063\u3066\u7a74\u304c\u3042\u3044\u3066\u3044\u308b\u304b\u3089\u3002", en: "107 I'm getting rid of this leather jacket because it's worn out at the elbows."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpMEi = new A.ConstantStringMap(2, {jp: "108 \u305d\u306e\u6df7\u305c\u5408\u308f\u305b\u305f\u3082\u306e\u306b\u5c0f\u9ea6\u7c89\u3092\u52a0\u3048\u3066\u3001\u3068\u308d\u307f\u304c\u3064\u304f\u307e\u3067\u304b\u304d\u6df7\u305c\u307e\u3057\u3087\u3046\u3002", en: "108 Add some flour to the mixture and stir it until it becomes thick."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XprxZ = new A.ConstantStringMap(2, {jp: "109 \u300c\u6b8b\u308a\u7269\u3092\u3069\u3046\u3057\u3088\u3046\uff1f\u300d \u300c\u3068\u308a\u3042\u3048\u305a\u51b7\u8535\u5eab\u306b\u5165\u308c\u3066\u304a\u3044\u3066\u3002 \u5f8c\u3067\u96fb\u5b50\u30ec\u30f3\u30b8\u3067\u6e29\u3081\u76f4\u3059\u3088\u3002\u300d", en: '109 "What should we do with the leftovers?" "Keep them in the fridge for now. I\'ll heat them in the microwave later."'}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_Xpgsm = new A.ConstantStringMap(2, {jp: "110 \u65b0\u3057\u3044\u30d1\u30bd\u30b3\u30f3\u306b\u5168\u984d\u3064\u304e\u8fbc\u3080\u3053\u3068\u3082\u3067\u304d\u305f\u304c\u3001\u8003\u3048\u76f4\u3057\u3066\u3001\u307e\u3055\u304b\u306e\u6642\u306e\u305f\u3081\u306b\u591a\u5c11\u306f\u6b8b\u3057\u3066\u304a\u304f\u3053\u3068\u306b\u3057\u305f\u3002", en: "110 I could have laid out all that money on a new PC, but on second thought I decided to put some aside for a rainy day."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpMO4 = new A.ConstantStringMap(2, {jp: "111 \u643a\u5e2f\u96fb\u8a71\u306f\u3061\u3087\u3063\u3068\u3057\u305f\u5fc5\u9700\u54c1\u306b\u306a\u3063\u305f\u3053\u3068\u3060\u3057\u3001\u305d\u308c\u306a\u3057\u3067\u306f\u3084\u3063\u3066\u3044\u3051\u306a\u3044\u3002", en: "111 A cell phone has become something of a necessity, and I can't do without one."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpMkQ = new A.ConstantStringMap(2, {jp: "112 \u30a4\u30b9\u306b\u3086\u3063\u305f\u308a\u5ea7\u3063\u3066\u304f\u3064\u308d\u3044\u3060\u9014\u7aef\u3001\u59bb\u306b\u96d1\u7528\u3092\u983c\u307e\u308c\u305f\u3002", en: "112 No sooner had I sat back and relaxed than my wife asked me to do the chores."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_Xpyjx = new A.ConstantStringMap(2, {jp: "113 \u5f7c\u5973\u306f\u8d64\u3061\u3083\u3093\u3092\u5bdd\u304b\u305b\u3066\u81ea\u5206\u3082\u96a3\u306b\u6a2a\u306b\u306a\u3063\u305f\u3002", en: "113 She laid the baby down and lay down beside him."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_GAyXb = new A.ConstantStringMap(13, {"101": B.Map_Xp0Ri, "102": B.Map_XpbDN, "103": B.Map_XpWkW, "104": B.Map_Xphoz, "105": B.Map_Xp8sI, "106": B.Map_Xpwsa0, "107": B.Map_XpsEs, "108": B.Map_XpMEi, "109": B.Map_XprxZ, "110": B.Map_Xpgsm, "111": B.Map_XpMO4, "112": B.Map_XpMkQ, "113": B.Map_Xpyjx}, B.List_GAW, type$.ConstantStringMap_of_String_and_Map_String_String);
