    B.Map_Xpz8A = new A.ConstantStringMap(2, {jp: "76 \u8b70\u9577\u306f\u79c1\u306e\u8a71\u3092\u906e\u3063\u3066\u3001\u300c\u8a71\u3057\u5408\u3044\u306f\u3053\u3053\u307e\u3067\u306b\u3057\u3066\u6c7a\u3092\u63a1\u308a\u307e\u3057\u3087\u3046\u3002\u300d\u3068\u8a00\u3063\u305f\u3002", en: '76 The chairman cut me off, saying, "Time to wind things up. Let\'s take a vote."'}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpeTT = new A.ConstantStringMap(2, {jp: "77 \u6211\u3005\u306f\u4f1a\u8b70\u3067\u7387\u76f4\u306a\u610f\u898b\u3092\u4ea4\u308f\u3057\u305f\u304c\u3001\u3053\u306e\u4ef6\u306b\u95a2\u3057\u3066\u306f\u307e\u3060\u5168\u4f53\u306e\u610f\u898b\u304c\u307e\u3068\u307e\u3089\u306a\u3044\u3002", en: "77 We exchanged frank opinions in the meeting, but consensus is yet to be reached regarding this matter."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_Xp4NM = new A.ConstantStringMap(2, {jp: "78 \u300c\u3042\u306a\u305f\u306f\u5f7c\u3068\u540c\u3058\u610f\u898b\uff1f \u305d\u308c\u3068\u3082\u9055\u3046\u306e\uff1f\u300d\u300c\u5f7c\u306e\u307b\u3046\u3092\u652f\u6301\u3059\u308b\u3088\u3002\u300d", en: '78 "Do you agree or disagree with him?" "I\'m on his side."'}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpGcl = new A.ConstantStringMap(2, {jp: "79 \u53b3\u5bc6\u306b\u8a00\u3048\u3070\u3001\u5f7c\u306e\u898b\u89e3\u306f\u79c1\u306e\u3082\u306e\u3068\u306f\u3044\u304f\u3089\u304b\u7570\u306a\u308b\u3002", en: "79 Strictly speaking, his view differs somewhat from mine."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XptVc = new A.ConstantStringMap(2, {jp: "80 \u3082\u3046\u4e00\u5ea6\u8a73\u3057\u304f\u8aac\u660e\u3057\u3066\u3044\u305f\u3060\u3051\u307e\u305b\u3093\u304b\uff1f \u304a\u8a71\u306e\u610f\u56f3\u304c\u308f\u304b\u308a\u307e\u305b\u3093\u3067\u3057\u305f\u3002", en: "80 Could you go over it again? I couldn't make out what you were getting at."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpAD4 = new A.ConstantStringMap(2, {jp: "81 \u50d5\u306e\u6848\u3092\u652f\u6301\u3057\u3066\u304f\u308c\u308b\u4eba\u306f\u6700\u521d\u306f\u8ab0\u3082\u3044\u306a\u304b\u3063\u305f\u3051\u308c\u3069\u3001\u6700\u5f8c\u306b\u306f\u307f\u3093\u306a\u3092\u8aac\u5f97\u3057\u3066\u8cdb\u540c\u3057\u3066\u3082\u3089\u3046\u3053\u3068\u304c\u3067\u304d\u305f\u3002", en: "81 No one backed me up at first, but eventually I talked everyone into going along with my plan."}, B.List_jp_en, type$.ConstantStringMap_String_String);
