    B.Map_Xp7ln = new A.ConstantStringMap(2, {jp: "83 \u3069\u3046\u3059\u308b\u304b\u3092\u6c7a\u3081\u308b\u3068\u304d\u3001\u50d5\u306f\u8ad6\u7406\u3067\u306f\u306a\u304f\u672c\u80fd\u3092\u5f53\u3066\u306b\u3059\u308b\u3002", en: "83 In making a decision, I rely not on logic but on instinct."}, B.List_jp_en, type$.ConstantStringMap_String_String);
