    B.Map_XpZGD = new A.ConstantStringMap(2, {jp: "87 \u79c1\u305f\u3061\u306f\u5f7c\u304c\u76f8\u624b\u306b\u52dd\u3064\u3053\u3068\u3092\u671f\u5f85\u3057\u305f\u304c\u3001\u5f7c\u306f\u305d\u306e\u671f\u5f85\u306b\u5fdc\u3048\u3089\u308c\u306a\u304b\u3063\u305f\u3002", en: "87 We expected him to defeat his opponent, but he failed to live up to our expectations."}, B.List_jp_en, type$.ConstantStringMap_String_String);
