    B.Map_XpccK = new A.ConstantStringMap(2, {jp: "40 \u904e\u53bb\u6570\u5e74\u9593\u305d\u306e\u554f\u984c\u3092\u898b\u904e\u3054\u3057\u3066\u3044\u305f\u5831\u9053\u6a5f\u95a2\u304c\uff64\u4eca\u3067\u306f\u3069\u3061\u3089\u304b\u3068\u8a00\u3048\u3070\u305d\u306e\u3053\u3068\u3092\u91cd\u8996\u3057\u904e\u304e\u3066\u3044\u308b\u3002", en: "40 For years the press overlooked the problem. But now, if anything, they are making too much of it."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpoqF = new A.ConstantStringMap(2, {jp: "41 \u7a40\u7269\u3092\u683d\u57f9\u3059\u308b\u3060\u3051\u3067\u306a\u304f\u3001\u305d\u306e\u8fb2\u696d\u7d4c\u55b6\u8005\u306f\u98df\u6599\u96d1\u8ca8\u5e97\u3082\u7d4c\u55b6\u3057\u3066\u3044\u308b\u3002", en: "41 As well as cultivating grain, the farmer runs a grocery store."}, B.List_jp_en, type$.ConstantStringMap_String_String);
