    B.Map_XpjrB = new A.ConstantStringMap(2, {jp: "44 \u5ff5\u306e\u305f\u3081\u30e1\u30e2\u3057\u3066\u304a\u304d\u307e\u3059\u3002\u8a18\u61b6\u529b\u304c\u60aa\u3044\u304b\u3089\u3002", en: "44 I'll write it down just in case, because I have a bad memory."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpXBY = new A.ConstantStringMap(2, {jp: "45 \u5f01\u8b77\u58eb\u306f\u4f9d\u983c\u4eba\u306b\u3001\u4fdd\u967a\u4f1a\u793e\u306b\u5bfe\u3057\u3066\u6cd5\u7684\u624b\u6bb5\u3092\u53d6\u308b\u4e8b\u3092\u52e7\u3081\u305f\u3002", en: "45 The lawyer recommended that his client take legal action against the insurance company."}, B.List_jp_en, type$.ConstantStringMap_String_String);
