    B.Map_XpGvh = new A.ConstantStringMap(2, {jp: "63 \u300c\u307b\u304b\u306b\u3054\u6ce8\u6587\u306f?\u300d\u300c\u3053\u3061\u3089\u3067\u304a\u53ec\u3057\u4e0a\u304c\u308a\u3067\u3059\u304b\uff1f\u300d\u300c\u6301\u3061\u5e30\u308a\u307e\u3059\u3002\u300d", en: '63 "Anything else?" "That\'s it." "For here or to go?" "To go."'}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpO1S = new A.ConstantStringMap(2, {jp: "64 \u300c\u3053\u306e\u6577\u7269\u306f\u304a\u3044\u304f\u3089\u3067\u3059\u304b?\u300d\u300c\u7a0e\u8fbc\u307f\u3067100\u30c9\u30eb\u3067\u3059\u300d\u300c\u3058\u3083\u3042\u3001\u3053\u308c\u306b\u3057\u307e\u3059\u3002\u300d", en: '64 "How much is this rug? "$100 including tax." "OK, I\'ll take it."'}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_Xpxkl = new A.ConstantStringMap(2, {jp: "65 \u305d\u306e\u30d1\u30f3\u30c4\u306f\u3042\u306a\u305f\u306b\u306f\u4f3c\u5408\u308f\u306a\u3044\u3068\u601d\u3046\u3002\u3053\u3063\u3061\u3092\u306f\u3044\u3066\u307f\u3066\u3002\u4eca\u3059\u3054\u304f\u6d41\u884c\u3063\u3066\u3044\u308b\u306e\u3088\u3002", en: "65 I don't think those pants look good on you. Try these on. They're really in now!"}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_Xp46y = new A.ConstantStringMap(2, {jp: "66 \u5f7c\u306f\u300c\u304a\u3064\u308a\u306f\u3044\u3044\u3067\u3059\u300d\u3068\u8a00\u3063\u3066\u3001\u6025\u3044\u3067\u30bf\u30af\u30b7\u30fc\u3092\u964d\u308a\u305f\u3002", en: '66 He got out of the cab in haste, saying, "Keep the change."'}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpCSc = new A.ConstantStringMap(2, {jp: "67 \u5f53\u5e97\u306e\u304a\u5ba2\u69d8\u306f\uff64\u308f\u305a\u304b\u306a\u8ffd\u52a0\u6599\u91d1\u3067\u914d\u9054\u30b5\u30fc\u30d3\u30b9\u3092\u3054\u5229\u7528\u3067\u304d\u307e\u3059\u3002", en: "67 Delivery service is available to our customers for a slight extra charge."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpE4Z = new A.ConstantStringMap(2, {jp: "68 \u300c\u3053\u308c\u306f\u50d5\u306e\u304a\u3054\u308a\u3002\u300d \u300c\u3060\u3081\u3088\u3002\u5916\u98df\u306e\u3068\u304d\u306f\u3044\u3064\u3082\u304a\u3054\u3063\u3066\u3082\u3089\u3063\u3066\u3044\u308b\u3057\u3002\u300d \u300c\u3046\u30fc\u3093\u3001\u308f\u304b\u3063\u305f\u3002\u3058\u3083\u3042\u5272\u308a\u52d8\u306b\u3057\u3088\u3046\u3002\u300d", en: '68 "It\'s on me." "No. You treat me every time we eat out." "Well, okay. Let\'s split the check then."'}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_Xpijl = new A.ConstantStringMap(2, {jp: "69 \u30b7\u30e7\u30c3\u30d4\u30f3\u30b0\u30bb\u30f3\u30bf\u30fc\u3092\u3076\u3089\u3076\u3089\u3057\u3066\u3044\u305f\u3089\u3001\u5076\u7136\u30b1\u30f3\u306b\u4f1a\u3063\u305f\u3002", en: "69 While I was hanging out at the mall, I ran into Ken."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpaBy = new A.ConstantStringMap(2, {jp: "70 \u73fe\u91d1\u304c\u8db3\u308a\u306a\u304b\u3063\u305f\u306e\u3067\u3001\u5148\u9031\u53e3\u5ea7\u306b\u5165\u308c\u305f1000\u30c9\u30eb\u3092\u5f15\u304d\u51fa\u3057\u305f\u3002", en: "70 I was short of cash, so I withdrew the $100 that I had deposited in my bank account last week."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpKyj = new A.ConstantStringMap(2, {jp: "71 \u5f7c\u5973\u306f\u5e30\u5b85\u9014\u4e2d\u306b\u30cf\u30f3\u30c9\u30d0\u30c3\u30b0\u3092\u76d7\u307e\u308c\u305f\u3002", en: "71 On her way home she was robbed of her purse."}, B.List_jp_en, type$.ConstantStringMap_String_String);
