    B.Map_Xp8Gl = new A.ConstantStringMap(2, {jp: "73 \u79c1\u304c\u7d04\u675f\u3092\u7834\u3063\u305f\u306e\u3067\u3001\u7f70\u3068\u3057\u3066\u4e21\u89aa\u306b\u9580\u9650\u3092\uff16\u6642\u306b\u3055\u308c\u305f\u3002", en: "73 My parents gave me a 6 pm curfew as a punishment because I broke my promise."}, B.List_jp_en, type$.ConstantStringMap_String_String);
