    B.Map_Xpq4m = new A.ConstantStringMap(2, {jp: "257 \u90fd\u4f1a\u306e\u6587\u5316\u306f\u591a\u304f\u306e\u4eba\u3005\u306e\u76ee\u306b\u306f\u9b45\u529b\u7684\u306b\u6620\u308b\u3002\u3068\u308a\u308f\u3051\u3001\u82e5\u8005\u306b\u3068\u3063\u3066\u306f\u3002", en: "257 Urban culture appears to be attractive to many people, in particular, to younger people."}, B.List_jp_en, type$.ConstantStringMap_String_String);
