    B.Map_XpizL = new A.ConstantStringMap(2, {jp: "326 \u30b8\u30e3\u30f3\u30af\u30d5\u30fc\u30c9\u306e\u904e\u5270\u306a\u6442\u53d6\u306f\u65e9\u6b7b\u306b\u306e\u4e00\u56e0\u306b\u306a\u308b\u3001\u3068\u3044\u3046\u306e\u304c\u6211\u3005\u306e\u4eee\u8aac\u3060\u3002", en: "326 Our hypothesis is that eating excessive amounts of junk food contributes to early mortality."}, B.List_jp_en, type$.ConstantStringMap_String_String);
