    B.List_FFX = A._setArrayType(makeConstList(["198", "199", "200", "201", "202", "203", "204", "205", "206", "207", "208", "209", "210", "211"]), type$.JSArray_String);
    B.Map_XpYM60 = new A.ConstantStringMap(2, {jp: "198 \u5f7c\u304c\u79c1\u306e\u76ee\u3092\u898b\u3088\u3046\u3068\u3057\u306a\u304b\u3063\u305f\u306e\u3067\u3001\u4f55\u304b\u3092\u96a0\u3057\u3066\u3044\u308b\u3068\u601d\u3063\u305f\u3002", en: "198 It occurred to me that he was holding something back, because he wouldn't look me in the eye."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpcAf0 = new A.ConstantStringMap(2, {jp: "199 \u5f7c\u5973\u306f\u6211\u6162\u3057\u304d\u308c\u306a\u304f\u306a\u308a\u3001\u895f\u9996\u3092\u3064\u304b\u3093\u3067\u5f7c\u3092\u306e\u306e\u3057\u3063\u305f\u3002", en: "199 When her patience gave out, she grabbed his collar and swore at him."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpHZS0 = new A.ConstantStringMap(2, {jp: "200 \u78ba\u304b\u306b\u3001\u79c1\u305f\u3061\u306f\u6642\u3005\u53e3\u3052\u3093\u304b\u3082\u3057\u307e\u3059\u304c\u3001\u666e\u6bb5\u306f\u4ef2\u826f\u304f\u3084\u3063\u3066\u3044\u307e\u3059\u3002", en: "200 I must admit we quarrel every now and then, but generally we're on good terms with each other."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpLkt = new A.ConstantStringMap(2, {jp: "201 \u300c\u541b\u306e\u5bb6\u306b\u5bc4\u3063\u3066\u3082\u3044\u3044\u304b\u3044\uff1f\u300d \u300c\u3082\u3061\u308d\u3093\u3044\u3044\u308f\u3088\u3002\u6c17\u517c\u306d\u306a\u304f\uff01\u300d", en: '201 "Do you mind if I stop by your house?" "No, not at all. Be my guest!"'}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpcKj = new A.ConstantStringMap(2, {jp: "202 \u3061\u3087\u3063\u3068\u5f85\u3063\u3066\u3066\u3002\u3059\u3050\u623b\u308b\u304b\u3089\u3002\u5207\u3089\u306a\u3044\u3067\u3088\uff01\uff08\u96fb\u8a71\u3067\uff09", en: "202 Hold on. I'll be right back. Don't hang up!"}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpuUr = new A.ConstantStringMap(2, {jp: "203 \u3046\u3061\u306b\u306f\u6cca\u3081\u3089\u308c\u306a\u3044\u308f\u3002\u4e00\u3064\u306b\u306f\u3001\u6642\u3005\u304a\u7236\u3055\u3093\u304c\u3075\u3089\u3063\u3068\u3084\u3063\u3066\u6765\u308b\u304b\u3089\u3002", en: "203 I can't put you up. For one thing, my dad drop in on me from time to time."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_Xpm05 = new A.ConstantStringMap(2, {jp: "204 \u30b8\u30a7\u30cb\u30d5\u30a1\u30fc\u304c\u3058\u3063\u3068\u7acb\u3063\u3066\u3044\u308b\u9593\u3001\u30dc\u30d6\u306f\u6b69\u9053\u3092\u884c\u3063\u305f\u308a\u6765\u305f\u308a\u3057\u3066\u3044\u305f\u3002", en: "204 While Jennifer was standing still, Bob was pacing back and forth along the sidewalk."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_Xplpj = new A.ConstantStringMap(2, {jp: "205 \u300c\u4ef2\u76f4\u308a\u3057\u3088\u3046\u3088\u3001\u30ea\u30b5\u3002\u300d \u300c\u79c1\u304c\u3044\u3066\u5f53\u7136\u3060\u306a\u3093\u3066\u601d\u308f\u306a\u3044\u3067\u3002\u79c1\u305f\u3061\u3001\u4eca\u5ea6\u306f\u6c38\u9060\u306b\u7d42\u308f\u308a\u3088\u3002\u672c\u6c17\u306a\u3093\u3060\u304b\u3089\uff01\u300d", en: '205 "Let\'s make up, Lisa." "Stop taking me for granted! We\'re through for good this time. I mean it!"'}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpcIc = new A.ConstantStringMap(2, {jp: "206 \u304a\u3044\uff01\u30ea\u30b5\u3001\u305d\u3046\u611f\u60c5\u7684\u306b\u306a\u308b\u306a\u3088\u3002\u541b\u3092\u50b7\u3064\u3051\u308b\u3064\u3082\u308a\u3058\u3083\u306a\u304b\u3063\u305f\u3093\u3060\u3002\u3058\u3063\u304f\u308a\u8a71\u3057\u5408\u304a\u3046\u3002", en: "206 Come on! Don't get so emotional, Lisa. I didn't mean to hurt you. Let's talk it over."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_Xp3Sx = new A.ConstantStringMap(2, {jp: "207 \u300c\u79c1\u3092\u88cf\u5207\u3063\u305f\u308f\u306d\uff01\u300d \u300c\u8a31\u3057\u3066\u304f\u308c\u3088\u3002\u3069\u3046\u3057\u305f\u3089\u57cb\u3081\u5408\u308f\u305b\u304c\u3067\u304d\u308b\u304b\u306a\u3042\uff1f\u300d \u300c\u4ed5\u8fd4\u3057\u3057\u3066\u3084\u308b\u3063\uff01\u300d", en: '207 "You betrayed me!" "Please forgive me. How can I make it up to you?" "I\'ll get even!"'}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpevA = new A.ConstantStringMap(2, {jp: "208 \u81ea\u5206\u306e\u7f6a\u306f\u96a0\u3057\u3066\u304a\u304b\u305a\u306b\u544a\u767d\u3057\u305f\u307b\u3046\u304c\u3044\u3044\u3002", en: "208 You should confess your sins rather than conceal them."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpsWu = new A.ConstantStringMap(2, {jp: "209 \u7d04\u675f\u306f\u5b88\u308a\u306a\u3055\u3044\u3002\u305d\u3046\u3057\u306a\u3044\u3068\u8a55\u5224\u3092\u843d\u3068\u3057\u307e\u3059\u3088\u3002", en: "209 Keep your word; otherwise you'll end up losing face."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpEWB = new A.ConstantStringMap(2, {jp: "210 \u30dc\u30d6\u306f\u81ea\u5206\u306e\u9053\u5fb3\u7684\u4fe1\u6761\u3092\u66f2\u3052\u306a\u3044\u7537\u3060\u3002\u6b63\u76f4\u3067\u3044\u308c\u3070\u6700\u5f8c\u306b\u306f\u5831\u308f\u308c\u308b\u3068\u4fe1\u3058\u3066\u3044\u308b\u3002", en: "210 Bob sticks to his moral principles and believes that honesty pays off in the long run."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpZul = new A.ConstantStringMap(2, {jp: "211 \u300c\u5143\u6c17\u3092\u51fa\u3057\u3066\u3002\u4ed5\u65b9\u306a\u3044\u308f\u3002\u300d \u300c\u3084\u308c\u308b\u3060\u3051\u306e\u3053\u3068\u306f\u3084\u3063\u305f\u3093\u3060\u3002\u300d \u300c\u308f\u304b\u3063\u3066\u308b\u3002\u904e\u304e\u305f\u3053\u3068\u306b\u304f\u3088\u304f\u3088\u3057\u306a\u3044\u3067\u3002\u3084\u308a\u76f4\u305b\u308b\u308f\u3088\uff01\u300d", en: '211 "Cheer up! You couldn\'t help it." "I did my best." "I know. Don\'t dwell on the past. You can start over!"'}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_FFay6 = new A.ConstantStringMap(14, {"198": B.Map_XpYM60, "199": B.Map_XpcAf0, "200": B.Map_XpHZS0, "201": B.Map_XpLkt, "202": B.Map_XpcKj, "203": B.Map_XpuUr, "204": B.Map_Xpm05, "205": B.Map_Xplpj, "206": B.Map_XpcIc, "207": B.Map_Xp3Sx, "208": B.Map_XpevA, "209": B.Map_XpsWu, "210": B.Map_XpEWB, "211": B.Map_XpZul}, B.List_FFX, type$.ConstantStringMap_of_String_and_Map_String_String);
