    B.Map_Xp4eY = new A.ConstantStringMap(2, {jp: "212 \u300c\u30b8\u30a7\u30fc\u30f3\u3001\u30bf\u30a4\u30e0\u30ba\u30fb\u30b9\u30af\u30a7\u30a2\u30fc\u307e\u3067\u4e57\u305b\u3066\u884c\u3063\u3066\u6b32\u3057\u3044\u3093\u3060\u3051\u3069\u3002\u300d \u300c\u305d\u3046\u3057\u3066\u3042\u3052\u305f\u3044\u306e\u306f\u5c71\u3005\u3060\u3051\u3069\u3002\u4eca\u3001\u5168\u7136\u6642\u9593\u304c\u306a\u3044\u306e\u3002\u300d", en: '212 "Jane, please do me a favor and give me a ride to Times Square." "I wish I could, but I\'m tied up right now."'}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpyLM = new A.ConstantStringMap(2, {jp: "213 \u3044\u3064\u3082\u306e\u3088\u3046\u306b\u3001\u30de\u30a4\u30af\u306f\u6642\u9593\u901a\u308a\u306b\u73fe\u308c\u305f\u3002\u672c\u5f53\u306b\u6642\u9593\u306b\u6b63\u78ba\u306a\u4eba\u3060\u3002\u300d", en: "213 As usual, Mike turned up on time. He's very punctual."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpkPa = new A.ConstantStringMap(2, {jp: "214 \u3053\u306e\u524d\u3001\u6df7\u96d1\u3057\u305f\u5e79\u7dda\u9053\u8def\u306e\u771f\u3093\u4e2d\u3067\u30ac\u30b9\u6b20\u3057\u3066\u3057\u307e\u3063\u305f\u3002", en: "214 The other day I ran out of gas in the middle of a busy Interstate."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpimX = new A.ConstantStringMap(2, {jp: "215 \u79c1\u306e\u524d\u3092\u8d70\u3063\u3066\u3044\u305f\u30c8\u30e9\u30c3\u30af\u304c\u30b9\u30ea\u30c3\u30d7\u3057\u3066\u6a2a\u8ee2\u3057\u3001\u7a4d\u307f\u8377\u3092\u8def\u9762\u3044\u3063\u3071\u3044\u306b\u6563\u4e71\u3055\u305b\u305f\u3002", en: "215 A truck driving ahead of me skidded, turned over, and scattered its load all over the road."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpE67 = new A.ConstantStringMap(2, {jp: "216 \u885d\u7a81\u3092\u907f\u3051\u3089\u308c\u305f\u306e\u306f\u904b\u304c\u826f\u304b\u3063\u305f\u3060\u3051\u3001\u3068\u5f7c\u306f\u56de\u60f3\u3057\u305f\u3002", en: "216 He recalled that a collision had been avoided by sheer luck."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpgQW0 = new A.ConstantStringMap(2, {jp: "217 \u7dca\u6025\u306e\u969b\u306b\u306f\u3001\u3059\u3050\u306b\u79c1\u306e\u4ee3\u7406\u4eba\u3068\u9023\u7d61\u3092\u53d6\u3063\u3066\u4e0b\u3055\u3044\u3002", en: "217 In case of an emergency, get in touch with my agent right away."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_Xp4AN0 = new A.ConstantStringMap(2, {jp: "218 \u300c\u30b8\u30a7\u30fc\u30f3\u3001\u4ffa\u305f\u3061\u306f\u3069\u3053\u306b\u5411\u304b\u3063\u3066\u308b\u3093\u3060\uff1f\u300d \u300c\u8ff7\u3063\u305f\u307f\u305f\u3044\u3002\u9055\u3046\u65b9\u5411\u306b\u6765\u3061\u3083\u3063\u305f\u308f\u3002\u300d \u300c\u4f55\u3060\u3088\u3002\u8eca\u3092\u6b62\u3081\u3066\u304f\u308c\uff01\u300d", en: '218 "Jane, where are we heading?" "I think we\'re lost. We went in the wrong direction." "Damn! Pull over!"'}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpUeD = new A.ConstantStringMap(2, {jp: "219 \u50d5\u306e\u3055\u3073\u3064\u3044\u305f\u30d5\u30a9\u30fc\u30c9\u304c\u6545\u969c\u3057\u3066\u3001\u4ea4\u5dee\u70b9\u3092\u3075\u3055\u3044\u3067\u3057\u307e\u3063\u305f\u3002", en: "219 My rusty Ford broke down, obstructing the intersection."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_Xp2CF = new A.ConstantStringMap(2, {jp: "220 \u8868\u9762\u306b\u7d30\u304b\u3044\u50b7\u3084\u3078\u3053\u307f\u304c\u305f\u304f\u3055\u3093\u3042\u308b\u304b\u3089\u3001\u78e8\u3044\u3066\u3082\u7121\u99c4\u3060\u3088\u3002", en: "220 There are so many fine scratches and dents on its surface, it's no use polishing it."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpCcz = new A.ConstantStringMap(2, {jp: "221 \u300c\u304a\u3044\u3001\u6e0b\u6ede\u306b\u306f\u307e\u3063\u3061\u3083\u3063\u305f\u3088\uff01\u300d \u300c\u71b1\u304f\u306a\u3089\u306a\u3044\u3067\u3001\u30b8\u30e7\u30fc\u3002\u8fd1\u9053\u3057\u307e\u3057\u3087\u3046\u3002\u6642\u9593\u307e\u3067\u306b\u306f\u7740\u3051\u308b\u308f\u3002\u300d", en: '221 "Hey, we\'re stuck in a traffic jam!" "Chill out, Joe. Let\'s take a shortcut! We\'ll get there in time."'}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_Xp79s = new A.ConstantStringMap(2, {jp: "222 \u300c\u30d1\u30f3\u30af\u3057\u3061\u3083\u3063\u305f\u3088\u3002\u624b\u3092\u8cb8\u3057\u3066\u304f\u308c\u308b\uff1f\u300d \u300c\u559c\u3093\u3067\u3002\u300d", en: '222 "I\'ve got a flat tire. Can you give me a hand?" "I\'d be glad to."'}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_Xptw9 = new A.ConstantStringMap(2, {jp: "223 \u30cf\u30f3\u30c9\u30eb\u304c\u304d\u304b\u306a\u304f\u306a\u3063\u305f\u6551\u6025\u8eca\u304c\u3001\u5371\u3046\u304f\u6b69\u884c\u8005\u3092\u3072\u304d\u305d\u3046\u306b\u306a\u3063\u305f\u3002", en: "223 The ambulance went out of control and came close to running over a pedestrian."}, B.List_jp_en, type$.ConstantStringMap_String_String);
