    B.Map_XpU44 = new A.ConstantStringMap(2, {jp: "187 \u5f7c\u306e\u3053\u3068\u3092\u7b11\u308f\u305a\u306b\u306f\u3044\u3089\u308c\u306a\u3044\u3002\u3070\u304b\u306a\u9593\u9055\u3044\u3092\u7e70\u308a\u8fd4\u3059\u304b\u3089\u306d\u3002\u304d\u3063\u3068\u5f7c\u306f\u61f2\u308a\u306a\u3044\u3093\u3060\u308d\u3046\u306a\u3002", en: "187 I can't help laughing at him because he keeps on making stupid mistakes. He'd be the last person to learn his lesson."}, B.List_jp_en, type$.ConstantStringMap_String_String);
