    B.Map_Xps4u = new A.ConstantStringMap(2, {jp: "332 \u300c\u666e\u6bb5\u306f\u4f55\u3092\u306a\u3055\u3063\u3066\u3044\u308b\u3093\u3067\u3059\u304b\uff1f\u300d \u300c\u5927\u5b66\u751f\u3067\u3059\u3002\u30cf\u30fc\u30d0\u30fc\u30c9\u306e1\u5e74\u3067\u3059\u3002\u300d \u300c\u5c02\u653b\u306f\uff1f\u300d \u300c\u54f2\u5b66\u3067\u3059\u3002\u300d", en: '332 "What do you do?" "I\'m a college student, a freshman at Harvard." "What\'s your major?" "Philosophy."'}, B.List_jp_en, type$.ConstantStringMap_String_String);
