    B.Map_XpKMB0 = new A.ConstantStringMap(2, {jp: "339 \u540c\u3058\u3088\u3046\u306a\u4eba\u3005\u304b\u3089\u306a\u308b\u79c1\u305f\u3061\u306e\u5730\u57df\u793e\u4f1a\u3067\u306f\u3001\u4f53\u5236\u306b\u5f93\u304a\u3046\u3068\u3059\u308b\u610f\u8b58\u306f\u4e0d\u53ef\u6b20\u306a\u8981\u7d20\u3067\u3042\u308b\u3002", en: "339 Conformity is an essential element of our homogeneous community."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpdOh = new A.ConstantStringMap(2, {jp: "340 \u4f1a\u793e\u306e\u305f\u3081\u306b\u3042\u304f\u305b\u304f\u50cd\u304f\u3088\u308a\u306f\u3001\u6211\u304c\u9053\u3092\u884c\u304f\u307b\u3046\u304c\u3044\u3044\u3002\u578b\u306b\u306f\u307e\u308d\u3046\u3068\u3057\u305f\u3063\u3066\u4f55\u306e\u5f97\u306b\u3082\u306a\u3089\u306a\u3044\u3088\uff01", en: "340 I'd rather go my own way than toil away for a company. Trying to fit into a mold gets me nowhere!"}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpNYu = new A.ConstantStringMap(2, {jp: "341 \u30c8\u30e0\u306f\u6027\u683c\u304c\u5f7c\u306e\u304a\u3058\u306b\u4f3c\u3066\u3044\u308b\u3002\u3064\u307e\u308a\u305d\u306e\u3001\u751f\u307e\u308c\u3064\u304d\u306e\u9811\u56fa\u8005\u3002\u5f7c\u306f\u7d76\u5bfe\u306b\u6298\u308c\u306a\u3044\u3002", en: "341 Tom takes after his uncle in personality. I mean, he is obstinate by nature. He never gives in."}, B.List_jp_en, type$.ConstantStringMap_String_String);
