    B.Map_Xpo6m = new A.ConstantStringMap(2, {jp: "282 \u3069\u3046\u3084\u3089\u30cb\u30c3\u30af\u306f\u3001\u81ea\u5206\u306e\u8ca0\u62c5\u304c\u5897\u3048\u308b\u304b\u3089\u305d\u306e\u4ed5\u4e8b\u3092\u5f15\u304d\u53d7\u3051\u305f\u304c\u3089\u306a\u304b\u3063\u305f\u3088\u3046\u3060\u3002", en: "282 Apparently, Nick wasn't willing to take on the task because it would just add to his burdens."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpIpU = new A.ConstantStringMap(2, {jp: "283 \u30dc\u30d6\u306f\u4eca\u591c\u3001\u5f7c\u5973\u3068\u30c7\u30fc\u30c8\u3059\u308b\u3064\u3082\u308a\u3060\u3063\u305f\u304c\u3001\u6b8b\u696d\u306b\u306a\u3063\u3066\u3057\u307e\u3063\u305f\u3002", en: "283 Bob had intended to take her out tonight, but he had to work overtime."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_Xpnuk = new A.ConstantStringMap(2, {jp: "284 \u300c\u9045\u304f\u3068\u3082\u91d1\u66dc\u65e5\u307e\u3067\u306b\u306f\u640d\u5931\u306e\u898b\u7a4d\u308a\u3092\u51fa\u3057\u3066\u4e0b\u3055\u3044\u3002\u300d \u300c\u4f55\u3068\u304b\u3084\u3063\u3066\u307f\u307e\u3057\u3087\u3046\u3002\u300d", en: '284 Please estimate the losses by Friday at the latest. "I\'ll manage it somehow."'}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_Xpk2a = new A.ConstantStringMap(2, {jp: "285 \u300c\u983c\u308a\u306b\u3057\u3066\u308b\u308f\u3001\u30cb\u30c3\u30af\u3002\u300d \u300c\u5927\u4e08\u592b\u3001\u304d\u3061\u3093\u3068\u3084\u3063\u3066\u304a\u304d\u307e\u3059\u3002\u300d \u300c\u3042\u308a\u304c\u3068\u3046\u3002\u611f\u8b1d\u3059\u308b\u308f\u3002\u300d \u300c\u3044\u3044\u3093\u3067\u3059\u3088\u3002\u300d", en: '285 "Nick, I\'m counting on you." "OK, I\'ll see to it." "Thanks, I appreciate it." "Don\'t mention it."'}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpCR9 = new A.ConstantStringMap(2, {jp: "286 \u5f7c\u306f\u4e0a\u53f8\u304c\u305d\u3070\u306b\u3044\u308b\u6642\u306f\u71b1\u5fc3\u306a\u3075\u308a\u3092\u3059\u308b\u3002", en: "286 He pretends to be enthusiastic when his boss is around."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_Xp21r = new A.ConstantStringMap(2, {jp: "287 \u5f7c\u306f\u540c\u50da\u3092\u8e0f\u307f\u53f0\u306b\u3057\u3066\u51fa\u4e16\u3057\u305f\u3002\u6065\u3092\u77e5\u308b\u3079\u304d\u3060\u3002", en: "287 He got promoted at the expense of his colleagues. He should be ashamed of himself."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpqPX = new A.ConstantStringMap(2, {jp: "288 \u666f\u6c17\u306e\u5f8c\u9000\u304c\u59cb\u307e\u308b\u3068\u3001\u77ed\u671f\u5951\u7d04\u793e\u54e1\u305f\u3061\u306f\u6b21\u3005\u306b\u4e00\u6642\u89e3\u96c7\u3092\u8a00\u3044\u6e21\u3055\u308c\u305f\u3002", en: "288 As the recession set in, temporary employees were laid off one after another."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpX7u = new A.ConstantStringMap(2, {jp: "289 \u6700\u8fd1\u3067\u306f\u3001\u591a\u304f\u306e\u4eba\u3005\u304c\u8077\u306b\u5c31\u304d\u305f\u304f\u3066\u3082\u5c31\u3051\u306a\u3044\u3067\u3044\u308b\u3002\u8ab0\u306e\u8cac\u4efb\u3060\u308d\u3046\uff1f", en: "289 Nowadays, many people are out of work against their will. Who is responsible for that?"}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpxwA = new A.ConstantStringMap(2, {jp: "290 \u79c1\u3082\u60b2\u89b3\u7684\u306b\u306a\u3063\u3066\u304d\u3066\u3001\u4ee5\u524d\u306f\u6c7a\u3057\u3066\u6c17\u306b\u306a\u3089\u306a\u304b\u3063\u305f\u3053\u3068\u306b\u4e0d\u5b89\u3092\u611f\u3058\u3066\u3044\u308b\u3002", en: "290 I've gotten pessimistic, and I'm worried about something I would never have been concerned about before."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_Xpe9t = new A.ConstantStringMap(2, {jp: "291 \u4eca\u65e5\u3067\u306f\u3001\u30b5\u30e9\u30ea\u30fc\u30de\u30f3\u3067\u3055\u3048\u5927\u5909\u306a\u82e6\u96e3\u306b\u76f4\u9762\u3057\u3066\u3044\u308b\u3002", en: "291 Today, even white-collar workers are confronted with great hardships."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpYZe = new A.ConstantStringMap(2, {jp: "292 \u5f53\u5c40\u306f\u901a\u8ca8\u3092\u5b89\u5b9a\u3055\u305b\u3088\u3046\u3068\u61f8\u547d\u3060\u304c\u3001\u3069\u3046\u306b\u3082\u306a\u3089\u306a\u3044\u3002", en: "292 The authorities are striving in vain to stabilize the currency."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpbDa = new A.ConstantStringMap(2, {jp: "293 \u65e5\u672c\u306e\u81a8\u5927\u306a\u8d64\u5b57\u3092\u524a\u6e1b\u3059\u308b\u3053\u3068\u304c\u4f55\u3088\u308a\u3082\u7dca\u6025\u3092\u8981\u3059\u308b\u3053\u3068\u3060\u3001\u3068\u3044\u3046\u7d50\u8ad6\u306b\u6211\u3005\u306f\u9054\u3057\u305f\u3002", en: "293 We've come to the conclusion that nothing is more urgent than reducing Japan's huge deficit"}, B.List_jp_en, type$.ConstantStringMap_String_String);
