    B.Map_XpGRW = new A.ConstantStringMap(2, {jp: "354 \u30cb\u30c3\u30af\u306f\u305d\u306e\u5831\u916c\u306b\u6e80\u8db3\u3057\u3066\u3044\u306a\u3044\u3002\u5f7c\u306f\u81ea\u5df1\u4e2d\u5fc3\u7684\u3067\u6b32\u304c\u6df1\u3044\u3002", en: "354 Nick is by no means satisfied with the reward. He is selfish and greedy."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_Xpek3 = new A.ConstantStringMap(2, {jp: "355 \u300c\u5168\u90e8\u3067200\u30c9\u30eb\u8cb8\u3057\u3066\u308b\u306e\u3001\u30dc\u30d6\u3002\u3044\u3064\u8fd4\u3059\u3064\u3082\u308a\u306a\u306e\uff1f\u300d \u300c\u3054\u3081\u3093\u3001\u91d1\u6b20\u306a\u3093\u3060\u3002\u300d \u300c\u307e\u305f\u306a\u306e\uff1f\u300d", en: '355 "You owe me $200 altogether, Bob. When are you going to pay me back?" "I\'m sorry. I\'m hard up." "There you go again!"'}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_Xpgg4 = new A.ConstantStringMap(2, {jp: "356 \u30d6\u30e9\u30a4\u30a2\u30f3\u304c\u9a5a\u3044\u305f\u3053\u3068\u306b\u3001\u501f\u91d1\u306f\u304b\u306a\u308a\u306e\u984d\u306b\u306a\u3063\u3066\u3044\u305f\u3002", en: "356 To Brian's surprise, his debt amounted to a considerable sum."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpChH = new A.ConstantStringMap(2, {jp: "357 \u904e\u53bb\u306e\u6804\u5149\u306b\u3057\u304c\u307f\u3064\u304f\u306e\u306f\u3084\u3081\u306a\u3044\u3068\u3001\u53d6\u308a\u6b8b\u3055\u308c\u308b\u308f\u3088\u3002", en: "357 Stop clinging to your glory days, or you'll be left behind."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpaZ8 = new A.ConstantStringMap(2, {jp: "358 \u4eca\u65e5\u306e\u53b3\u3057\u3044\u73fe\u5b9f\u304b\u3089\u306f\u9003\u308c\u3089\u308c\u306a\u3044\u4ee5\u4e0a\u3001\u305d\u308c\u306b\u9806\u5fdc\u3057\u306a\u3051\u308c\u3070\u306a\u3089\u306a\u3044\u3002", en: "358 You cannot escape from today's harsh realities, so you must adapt to them."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_Xpah5 = new A.ConstantStringMap(2, {jp: "359 \u7e41\u6804\u306f\u6c38\u9060\u306b\u7d9a\u304f\u3082\u306e\u3067\u306f\u306a\u3044\u3002\u3064\u307e\u308a\u3001\u3044\u3064\u304b\u306f\u7d42\u308f\u308a\u3092\u8fce\u3048\u308b\u3082\u306e\u3060\u3002", en: "359 Prosperity does not last forever. In other words, it will come to an end one of these days."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpO4o = new A.ConstantStringMap(2, {jp: "360 \u305d\u306e\u8077\u7a2e\u306b\u306f\u76f8\u5fdc\u306e\u8cc7\u683c\u3084\u80fd\u529b\u304c\u5fc5\u8981\u3067\u3001\u30b3\u30f3\u30d4\u30e5\u30fc\u30bf\u30fc\u304c\u4f7f\u3048\u308b\u3053\u3068\u306f\u7d76\u5bfe\u6761\u4ef6\u3067\u3042\u308b\u3002", en: "360 Proper qualifications are required for the position; computer literacy is a must."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpLlB = new A.ConstantStringMap(2, {jp: "361 \u3053\u306e\u5c01\u7b52\u306b\u5c65\u6b74\u66f8\u3082\u5165\u308c\u3066\u4eba\u4e8b\u90e8\u306b\u63d0\u51fa\u3057\u3066\u4e0b\u3055\u3044\u3002", en: "361 Enclose your resume in this envelope and submit it to the personnel department."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpLbX = new A.ConstantStringMap(2, {jp: "362 \u7269\u4e8b\u304c\u3046\u307e\u304f\u884c\u304f\u3068\u4fe1\u3058\u308b\u306a\u3093\u3066\u541b\u3082\u697d\u89b3\u7684\u3060\u306d\u3002\u53ef\u80fd\u6027\u306f\u305b\u3044\u305c\u304450%\u3060\u3088\u3002", en: "362 It's optimistic of you to believe that things will work out. At best there's a fifty-fifty chance."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpBCG = new A.ConstantStringMap(2, {jp: "363 \u767b\u9332\u7528\u7d19\u306f\u7121\u6599\u3067\u5165\u624b\u3067\u304d\u307e\u3059\u3002", en: "363 Registration forms can be obtained free of charge."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_Xp4uk = new A.ConstantStringMap(2, {jp: "364 \u3053\u306e\u8b1b\u7fd2\u4f1a\u306b\u53c2\u52a0\u3092\u3054\u5e0c\u671b\u306e\u65b9\u306f\u3001\u4eca\u3059\u3050\u304a\u96fb\u8a71\u4e0b\u3055\u3044\u3002", en: "364 Please give us a call now if you want to participate in the workshop!"}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_Xp2nP = new A.ConstantStringMap(2, {jp: "365 \u3055\u3089\u306b\u3054\u8cea\u554f\u304c\u3042\u308a\u307e\u3057\u305f\u3089\u3001\u3069\u3046\u305e\u3054\u9060\u616e\u306a\u304f\u30d5\u30ea\u30fc\u30c0\u30a4\u30e4\u30eb1-800-555-1212\u307e\u3067\u304a\u96fb\u8a71\u304f\u3060\u3055\u3044\u3002", en: "365 For further inquiries, please feel free to contact us toll-free at 1-800-555-1212."}, B.List_jp_en, type$.ConstantStringMap_String_String);
