    B.Map_Xp9sg = new A.ConstantStringMap(2, {jp: "294 \u30a2\u30f3\u30b1\u30fc\u30c8\u7528\u7d19\u304c\u7121\u4f5c\u70ba\u306b\u914d\u5e03\u3055\u308c\u305f\u3002", en: "294 The questionnaires were distributed at random."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpzK0 = new A.ConstantStringMap(2, {jp: "295 \u4ee5\u4e0b\u306e\u7a7a\u6b04\u90e8\u5206\u306b\u3054\u8a18\u5165\u3044\u305f\u3060\u304f\u3060\u3051\u3067\u7d50\u69cb\u3067\u3059\u3002\uff08\u9ed2\u307e\u305f\u306f\u9752\u30a4\u30f3\u30af\u3067\u306f\u3063\u304d\u308a\u3068\u66f8\u3044\u3066\u4e0b\u3055\u3044\uff09", en: "295 All you have to do is fill in the blanks below. (Please print in black or blue ink.)"}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_Xpsfd = new A.ConstantStringMap(2, {jp: "296 10%\u306e\u5272\u5f15\u306b\u52a0\u3048\u3066\u3001\u7121\u6599\u306e\u30aa\u30d7\u30b7\u30e7\u30f3\u30c4\u30a2\u30fc\u3092\u4e00\u3064\u9078\u629e\u3067\u304d\u307e\u3059\u3002", en: "296 In addition to a 10% discount, you can pick out an optional excursion for free."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_Xpqxj = new A.ConstantStringMap(2, {jp: "297 \u5404\u76ee\u7684\u5730\u307e\u3067\u306e\u5f80\u5fa9\u6599\u91d1\u306f\u4e0b\u8a18\u306e\u901a\u308a\u3067\u3059\u3002", en: "297 Round-trip fares to each destination are as follows."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpFQs = new A.ConstantStringMap(2, {jp: "298 \u300c\u4e8b\u524d\u306b\u4e88\u7d04\u306e\u78ba\u8a8d\u3092\u3059\u308b\u306e\u3092\u5fd8\u308c\u306a\u3044\u3067\u306d\u3002\u300d \u300c\u3048\u3048\u3002\u300d", en: '298 "Don\'t forget to confirm your reservation in advance." "I won\'t."'}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpQWw = new A.ConstantStringMap(2, {jp: "299 \u9045\u304f\u3068\u3082\u51fa\u767a\u6642\u523b\u306e45\u5206\u524d\u306b\u306f\u642d\u4e57\u624b\u7d9a\u304d\u3092\u5fc5\u305a\u5b8c\u4e86\u3055\u305b\u3066\u4e0b\u3055\u3044\u3002", en: "299 Be sure to check in at least 45 minutes prior to departure time."}, B.List_jp_en, type$.ConstantStringMap_String_String);
