    B.Map_XpcvT = new A.ConstantStringMap(2, {jp: "367 \u7814\u4fee\u751f\u305f\u3061\u306f\u3001\u5f7c\u304b\u3089\u4e0e\u3048\u3089\u308c\u305f\u6307\u793a\u304c\u3055\u3063\u3071\u308a\u308f\u304b\u3089\u306a\u304b\u3063\u305f\u3002", en: "367 He gave instructions to the trainees, but they couldn't make heads or tails of them."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_Xpqjf = new A.ConstantStringMap(2, {jp: "368 \u4e00\u5ea6\u306b\u4e8c\u3064\u306e\u3053\u3068\u306f\u3067\u304d\u306a\u3044\u3088\u3002\u7121\u7406\u306b\u6c7a\u307e\u3063\u3066\u308b\u3002\u4e00\u3064\u305a\u3064\u3084\u308a\u306a\u3088\u3002", en: "368 You can't do two things at one time! It's out of the question. Do them one by one."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_Xp6D4 = new A.ConstantStringMap(2, {jp: "369 \u300c\u30dc\u30d6\u3001\u5f7c\u5973\u306e\u90aa\u9b54\u3092\u3057\u3061\u3083\u3060\u3081\u3060\u305e\u3002\u3061\u3087\u3063\u304b\u3044\u3092\u51fa\u3059\u306a\u3088\u3002\u300d\u3068\u5f7c\u306f\u5c0f\u58f0\u3067\u8a00\u3063\u305f\u3002", en: '369 "Bob, don\'t disturb her. Mind your own business," he whispered.'}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpjvJ = new A.ConstantStringMap(2, {jp: "370 \u305d\u3046\u3084\u3063\u3066\u3057\u3064\u3053\u304f\u5f7c\u5973\u3092\u56f0\u3089\u305b\u308b\u3068\u3001\u5f7c\u5973\u3082\u6012\u308a\u51fa\u3059\u305e\u3002", en: "370 If you persist in bothering her like that, she'll lose her temper."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpW7k = new A.ConstantStringMap(2, {jp: "371 \u5f7c\u306f\u3042\u307e\u308a\u306b\u5b50\u4f9b\u3060\u304b\u3089\u8a98\u60d1\u306b\u52dd\u3066\u306a\u304b\u3063\u305f\u3002", en: "371 He was so childish that he couldn't resist temptation."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpyrN = new A.ConstantStringMap(2, {jp: "372 \u300c\u304e\u3083\u3042\u304e\u3083\u3042\u8a00\u3046\u306e\u306f\u3084\u3081\u3066\u3002\u672c\u5f53\u306b\u3044\u3089\u3044\u3089\u3059\u308b\u308f\u3002\u300d\u3068\u5f7c\u5973\u306f\u53eb\u3093\u3060\u3002", en: '372 "Stop making a fuss. It really gets on my nerves!" she shouted.'}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_Xpwkh = new A.ConstantStringMap(2, {jp: "373 \u30cb\u30c3\u30af\u306b\u53e3\u7b54\u3048\u3057\u305f\u3063\u3066\u7121\u99c4\u3060\u3088\u3002\u8a00\u3063\u3066\u307f\u308a\u3083\u5f7c\u306f\u72ec\u88c1\u8005\u3055\u3002", en: '373 There\'s no point in talking back to Nick. He is a "dictator," so to speak.'}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_Xpv0h = new A.ConstantStringMap(2, {jp: "374 \u5f7c\u5973\u305f\u3061\u306f\u5f7c\u306e\u524d\u3067\u306f\u3068\u3066\u3082\u793c\u5100\u6b63\u3057\u3044\u304c\u3001\u5b9f\u969b\u306b\u306f\u3001\u3044\u3064\u3082\u9670\u53e3\u3092\u53e9\u3044\u3066\u3044\u308b\u3002", en: "374 They are very polite in his presence, but actually, they always talk about him behind his back."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpAbR = new A.ConstantStringMap(2, {jp: "375 \u300c\u30cb\u30c3\u30af\u3092\u8efd\u8511\u3057\u3066\u3044\u308b\u3093\u3060\u308d\u3046\uff1f\u300d \u300c\u3068\u3093\u3067\u3082\u306a\u3044\uff01\u5c0a\u656c\u3057\u3066\u3044\u308b\u308f\u3002\u300d", en: '375 "You despise Nick, don\'t you?" "On the contrary! I look up to him."'}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpSwR = new A.ConstantStringMap(2, {jp: "376 \u5f7c\u306e\u7d76\u3048\u9593\u306a\u3044\u4fae\u8fb1\u304c\u3001\u5f7c\u5973\u306e\u6012\u308a\u3092\u304b\u304d\u7acb\u3066\u305f\u3002", en: "376 His constant insults aroused her anger."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpoqK = new A.ConstantStringMap(2, {jp: "377 \u66f8\u985e\u306e\u6574\u7406\u3068\u304b\u304a\u8336\u304f\u307f\u306b\u306f\u3001\u307b\u3068\u307b\u3068\u3046\u3093\u3056\u308a\u3002\u4f1a\u793e\u3092\u8f9e\u3081\u308b\u3053\u3068\u306b\u3057\u305f\u308f\uff01", en: "377 I'm fed up with just shuffling papers and pouring coffee. I've made up my mind to quit!"}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_Xp51o = new A.ConstantStringMap(2, {jp: "378 \u5b9f\u969b\u3001\u591a\u304f\u306e\u4eba\u3005\u304c\u5bb6\u8a08\u306e\u3084\u308a\u304f\u308a\u306b\u82e6\u52b4\u3057\u3066\u3044\u308b\u3002\u6708\u300510\u4e07\u5186\u3067\u3069\u3046\u3057\u305f\u3089\u3084\u3063\u3066\u3044\u3051\u308b\u3060\u308d\u3046\uff1f", en: "378 In reality, many people have difficulty making ends meet. How can you get by on 100,000 yen a month?"}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_Xp5cP = new A.ConstantStringMap(2, {jp: "379 \u5973\u6027\u8077\u54e1\u304c\u81ea\u5206\u305f\u3061\u306e\u65e5\u5e38\u696d\u52d9\u306b\u4e0d\u6e80\u3092\u8a00\u3046\u306e\u3082\u3082\u3063\u3068\u3082\u3060\u3002\u5168\u304f\u3084\u308a\u304c\u3044\u306e\u7121\u3044\u4ed5\u4e8b\u3060\u304b\u3089\u3002", en: "379 Female clerks may well complain about their routines, which are not challenging at all."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_Xp3dk = new A.ConstantStringMap(2, {jp: "380 \u629c\u672c\u7684\u306b\u4e8b\u696d\u306e\u518d\u69cb\u7bc9\u3092\u304a\u3053\u306a\u3063\u305f\u304a\u304b\u3052\u3067\u3001\u5f53\u793e\u306e\u9ed2\u5b57\u306f3\u500d\u306b\u81a8\u3089\u3093\u3060\u3002", en: "380 Thanks to a fundamental restructuring, our surplus has swelled threefold."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_Xp46y0 = new A.ConstantStringMap(2, {jp: "381 \u73fe\u5728\u306e\u591a\u304f\u306e\u4eba\u304c\u3001\u4f1a\u793e\u306b\u5bfe\u3059\u308b\u5fe0\u8aa0\u306f\u3070\u304b\u3052\u305f\u8003\u3048\u3060\u3068\u601d\u3063\u3066\u3044\u308b\u3002", en: "381 Many people today think of loyalty to a company as an absurd notion."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpaTW = new A.ConstantStringMap(2, {jp: "382 \u50d5\u306f\u9060\u3044\u90ca\u5916\u304b\u3089\u308f\u3056\u308f\u3056\u901a\u52e4\u3057\u306a\u3051\u308c\u3070\u306a\u3089\u306a\u3044\u3002\u3082\u3046\u3046\u3093\u3056\u308a\u3060\uff01", en: "382 I have to commute all the way from a distant suburb. I'm sick of it!"}, B.List_jp_en, type$.ConstantStringMap_String_String);
