    B.Map_XpsAl0 = new A.ConstantStringMap(2, {jp: "304 \u3059\u307f\u307e\u305b\u3093\u3002\u30cb\u30e5\u30fc\u30e8\u30fc\u30af\u5e02\u8857\u306b\u884c\u304f\u30b7\u30e3\u30c8\u30eb\u30d0\u30b9\u306f\u3069\u306e\u4f4d\u306e\u9593\u9694\u3067\u8d70\u3063\u3066\u307e\u3059\u304b\uff1f", en: "304 Excuse me. How often do the shuttle buses run to downtown New York?"}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpA4L = new A.ConstantStringMap(2, {jp: "305 \u305d\u306e\u30e2\u30fc\u30c6\u30eb\u306f400\u4eba\u3082\u306e\u5bbf\u6cca\u5ba2\u3092\u6cca\u3081\u3089\u308c\u308b\u3002", en: "305 The motel can accommodate as many as 400 guests."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XppI1 = new A.ConstantStringMap(2, {jp: "306 \u3053\u306e\u30b9\u30a4\u30fc\u30c8\u30eb\u30fc\u30e0\u306f\u3001\u79c1\u306e\u6301\u3063\u3066\u3044\u308b\u30de\u30f3\u30b7\u30e7\u30f3\u306e3\u500d\u306e\u5e83\u3055\u3060\u3002", en: "306 This suite is three times larger than my condominium."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_Xpmtc = new A.ConstantStringMap(2, {jp: "307 \u3053\u306e\u65bd\u8a2d\u5185\u3067\u306e\u30b4\u30df\u306e\u6295\u3052\u6368\u3066\u306b\u306f\u3001\u6700\u9ad8500\u30c9\u30eb\u306e\u7f70\u91d1\u304c\u79d1\u305b\u3089\u308c\u308b\u3053\u3068\u304c\u3042\u308a\u307e\u3059\u3002", en: "307 Littering in this facility is subject to a maximum fine of $500."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpcGl = new A.ConstantStringMap(2, {jp: "308 \u3042\u306e\u30ec\u30b9\u30c8\u30e9\u30f3\u306f\u3044\u3064\u3067\u3082\u6df7\u3093\u3067\u3044\u308b\u304b\u3089\u3001\u4e8b\u524d\u306b\u4e88\u7d04\u3092\u3057\u305f\u65b9\u304c\u3044\u3044\u3002", en: "308 That restaurant is always packed. We'd better make a reservation beforehand."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpES6 = new A.ConstantStringMap(2, {jp: "309 \u300c\u98df\u4e8b\u306e\u90aa\u9b54\u3092\u3057\u3066\u60aa\u3044\u3093\u3060\u3051\u3069\u3001\u3061\u3087\u3063\u3068\u5185\u5bc6\u306b\u8a71\u304c\u3057\u305f\u3044\u306e\u3002\u300d \u300c\u5f8c\u3067\u541b\u306e\u3068\u3053\u308d\u306b\u884c\u304f\u3088\u3002\u300d", en: '309 Sorry to interrupt your meal but I\'d like a word with you in private. "Can I get back to you later?"'}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpFS00 = new A.ConstantStringMap(2, {jp: "310 \u6599\u7406\u4eba\u306f\u5f7c\u306e\u4fe1\u3058\u3089\u308c\u306a\u3044\u307b\u3069\u306e\u98df\u6b32\u306b\u3068\u3066\u3082\u9a5a\u3044\u305f\u3002", en: "310 The cook was astonished at his incredible appetite."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpXQQ = new A.ConstantStringMap(2, {jp: "311 \u300c\u4e0b\u3067\u4f55\u304c\u8d77\u3053\u3063\u3066\u3044\u308b\u306e\uff1f \u3059\u3054\u304f\u6c17\u306b\u306a\u308b\u308f\u3002\u300d \u300c\u3055\u3042\u3001\u4f55\u3060\u308d\u3046\u3002\u300d", en: '311 "What\'s going on down there? I\'m curious." "I have no idea."'}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpA8J = new A.ConstantStringMap(2, {jp: "312 \u8208\u596e\u3057\u305f\u30d5\u30a1\u30f3\u305f\u3061\u304c\u3001\u30de\u30a4\u30b1\u30eb\u3092\u4e00\u76ee\u898b\u3088\u3046\u3068\u88cf\u53e3\u306b\u7fa4\u304c\u3063\u3066\u3044\u305f\u3002", en: "312 Excited fans were hanging around the rear exit hoping to catch a glimpse of Michael."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpYoe = new A.ConstantStringMap(2, {jp: "313 \u5f7c\u3089\u306f\u6709\u540d\u4eba\u3068\u51fa\u304f\u308f\u3059\u306a\u308a\u3001\u30b5\u30a4\u30f3\u3092\u306d\u3060\u3063\u305f\u3002", en: "313 On encountering the celebrity, they asked for his autograph."}, B.List_jp_en, type$.ConstantStringMap_String_String);
