    B.List_UlX = A._setArrayType(makeConstList(["419", "420", "421", "422", "423", "424", "425", "426", "427", "428", "429", "430", "431", "432"]), type$.JSArray_String);
    B.Map_Xp4pJ = new A.ConstantStringMap(2, {jp: "419 \u6211\u3005\u306f\u3001\u8ab0\u3067\u3042\u308d\u3046\u3068\u30c6\u30ed\u6d3b\u52d5\u306b\u643a\u308f\u308b\u8005\u306b\u5bdb\u5bb9\u3067\u3044\u308b\u3064\u3082\u308a\u306f\u306a\u3044\u3002", en: "419 We will not tolerate anyone who engages in terrorism."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_Xp5sZ = new A.ConstantStringMap(2, {jp: "420 \u60aa\u540d\u9ad8\u3044\u53cd\u4e71\u5175\u306f\u3064\u3044\u306b\u6355\u3089\u3048\u3089\u308c\u3001\u62d8\u7f6e\u6240\u306b\u8eab\u67c4\u3092\u62d8\u675f\u3055\u308c\u305f\u3002", en: "420 The notorious rebel was ultimately captured and confined to jail."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpGXl = new A.ConstantStringMap(2, {jp: "421 \u66b4\u52d5\u3092\u93ae\u5727\u3059\u308b\u305f\u3081\u306b\u3001\u76f4\u3061\u306b\u8ecd\u968a\u304c\u6d3e\u9063\u3055\u308c\u305f\u3002", en: "421 Troops were swiftly called in to put down the riot."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_Xp8v0 = new A.ConstantStringMap(2, {jp: "422 \u79c1\u305f\u3061\u306f\u66b4\u529b\u306b\u983c\u308b\u306e\u3067\u306f\u306a\u304f\u3001\u7406\u6027\u306b\u8a34\u3048\u308b\u3079\u304d\u3060\u3002", en: "422 We should appeal to reason instead of resorting to violence."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XppHb = new A.ConstantStringMap(2, {jp: "423 \u5f53\u5206\u306e\u9593\u306f\u67d4\u8edf\u306a\u6226\u8853\u3092\u3068\u3063\u3066\u307f\u3066\u306f\u3069\u3046\u3067\u3057\u3087\u3046\u3002", en: "423 I suggest we adopt flexible tactics for the moment."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_Xp0Lo = new A.ConstantStringMap(2, {jp: "424 \u8ecd\u306f\u5168\u9818\u571f\u3092\u5360\u9818\u3059\u308b\u3053\u3068\u306b\u6210\u529f\u3057\u305f\u3002", en: "424 The armed forces succeeded in occupying the entire territory."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_Xpuh0 = new A.ConstantStringMap(2, {jp: "425 \u3053\u306e\u3088\u3046\u306a\u72b6\u6cc1\u3067\u306f\u3001\u6575\u306f\u964d\u4f0f\u305b\u3056\u308b\u3092\u5f97\u306a\u3044\u3002\u5f7c\u3089\u304c\u3053\u308c\u4ee5\u4e0a\u6301\u3061\u3053\u305f\u3048\u308b\u3053\u3068\u306f\u4e0d\u53ef\u80fd\u3060\u3002", en: "425 Under the circumstances, the enemy has no choice but to surrender. They can't hold out any longer."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpKLc = new A.ConstantStringMap(2, {jp: "426 \u9045\u304b\u308c\u65e9\u304b\u308c\u3001\u4eba\u8cea\u305f\u3061\u306f\u89e3\u653e\u3055\u308c\u308b\u3060\u308d\u3046\u3002", en: "426 Sooner or later, the hostages will be set free."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpubB = new A.ConstantStringMap(2, {jp: "427 \u5c02\u5236\u653f\u6cbb\u306b\u3088\u308b\u652f\u914d\u306e\u3082\u3068\u3067\u3001\u7f6a\u306e\u306a\u3044\u4eba\u3005\u304c\u5e02\u6c11\u6a29\u3092\u5265\u596a\u3055\u308c\u305f\u3002", en: "427 Under the reign of tyranny, innocent people were deprived of their citizenship."}, B.List_jp_en, type$.ConstantStringMap_String_String);
