    B.Map_XpkW7 = new A.ConstantStringMap(2, {jp: "514 \u300c\u304a\u5148\u306b\u3069\u3046\u305e\u3002\u300d\u300c\u3044\u3084\u3001\u3042\u306a\u305f\u306e\u65b9\u3053\u305d\u304a\u5148\u306b\u3069\u3046\u305e\u3002\u300d\u300c\u3059\u307f\u307e\u305b\u3093\u3002\u300d\u300c\u3069\u3046\u3044\u305f\u3057\u307e\u3057\u3066\u3002\u300d", en: '514 "After you." "No pleasure, you go ahead." "Thanks." "You\'re welcome."'}, B.List_jp_en, type$.ConstantStringMap_String_String);
