    B.Map_XpECG = new A.ConstantStringMap(2, {jp: "531 \u300c\u30b8\u30a7\u30cb\u30d5\u30a1\u30fc\u306b\u3060\u307e\u3055\u308c\u305f\uff01\u300d\u300c\u5f7c\u5973\u3092\u4fe1\u3058\u306a\u3044\u304f\u3089\u3044\u306e\u5206\u5225\u304c\u3042\u3063\u3066\u3082\u826f\u304b\u3063\u305f\u306e\u306b\u3002\u300d", en: '531 "Jennifer deceived me!" "You should have known better than to trust her."'}, B.List_jp_en, type$.ConstantStringMap_String_String);
