    B.Map_XpkKa = new A.ConstantStringMap(2, {jp: "534 \u300c\u30b8\u30a7\u30cb\u30d5\u30a1\u30fc\u304c\u4ffa\u3092\u3075\u3063\u3066\u4ed6\u306e\u7537\u306e\u3068\u3053\u308d\u306b\u3044\u3063\u305f\u3088\u3002\u300d\u300c\u3048\u3063\u3001\u305d\u308c\u306f\u8f9b\u3044\u308f\u306d\u3002\u300d\u300c\u305d\u3046\u3067\u3082\u306a\u3044\u3088\u3002\u6163\u308c\u3066\u308b\u3088\u3002\u300d", en: '534 "Jennifer left me for another guy." "Oh, you must be upset." "Not really. I\'m used to it."'}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpEGZ = new A.ConstantStringMap(2, {jp: "535 \u300c\u5f7c\u5973\u304c\u898b\u9001\u308a\u306b\u6765\u306a\u304b\u3063\u305f\u306e\u3082\u5f53\u7136\u3060\u3088\u3002\u300d\u300c\u3069\u3046\u3057\u3066\uff1f\u300d\u300c\u4e8c\u4eba\u306f\u5225\u308c\u305f\u3093\u3060\u3002\u300d\u300c\u3048\u3063\u3001\u304b\u308f\u3044\u305d\u3046\u306b\uff01\u300d", en: '535 "No wonder she didn\'t show up to see him off." "How come?" "They broke up." "Oh, what a pity!"'}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_Xpgkc0 = new A.ConstantStringMap(2, {jp: "536 \u300c\u3053\u3053\u3067\u81ea\u5206\u4e00\u4eba\u3060\u3051\u751f\u304d\u3066\u3044\u304f\u306a\u3093\u3066\u62f7\u554f\u3060\u300d\u3068\u5f7c\u306f\u3059\u3059\u308a\u6ce3\u304d\u3057\u3066\u8a00\u3063\u305f\u3002", en: '536 "Living here all by myself is torture!" he sobbed.'}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpmBv = new A.ConstantStringMap(2, {jp: "537 \u300c\u6b63\u76f4\u8a00\u3046\u3068\u79c1\u3001\u30b1\u30f3\u306b\u5922\u4e2d\u306a\u306e\u3002\u3060\u3063\u3066\u3001\u52c7\u6562\u3067\u81ea\u5206\u306b\u81ea\u4fe1\u3092\u6301\u3063\u3066\u3044\u3066\u3001\u305d\u308c\u306b\u5371\u967a\u3092\u5192\u3059\u3053\u3068\u3092\u6c7a\u3057\u3066\u6050\u308c\u306a\u3044\u3067\u3057\u3087\u3002\u300d\u300c\u79c1\u306a\u3089\u30c7\u30fc\u30c8\u306b\u8a98\u3046\u308f\u3002\u300d", en: '537 "To be honest, I\'m crazy about Ken because he\'s brave, self-confident, and never afraid of taking risks. " "If I were you, I\'d ask him out!"'}, B.List_jp_en, type$.ConstantStringMap_String_String);
