    B.Map_Xp5uk = new A.ConstantStringMap(2, {jp: "539 \u300c\u30b8\u30a7\u30cb\u30d5\u30a1\u30fc\u306b\u305a\u3063\u3068\u3060\u307e\u3055\u308c\u3066\u3044\u305f\u306e\u304c\u5206\u304b\u3063\u3066\u304d\u305f\u3088\u3002\u300d\u300c\u4f55\u3066\u3046\u3076\u306a\u306e\u3002\u5f7c\u5973\u306e\u672c\u6027\u304c\u898b\u629c\u3051\u306a\u304b\u3063\u305f\u306e\uff1f\u300d", en: '539 "It dawned on me that I had been taken in by Jennifer all along." "How naive! Didn\'t you see through her?"'}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_Xpm5H = new A.ConstantStringMap(2, {jp: "540 \u5b9f\u969b\u3001\u5f7c\u5973\u306f\u8ab0\u304b\u3068\u4ed8\u304d\u5408\u3063\u3066\u3044\u308b\u3051\u308c\u3069\u3082\u3001\u50d5\u306f\u5f7c\u5973\u3092\u8ae6\u3081\u306a\u3044\u3002", en: "540 Even though she is seeing someone else, I won't give her up."}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_XpxYe = new A.ConstantStringMap(2, {jp: "541 \u300c\u3084\u3042\u3001\u30b8\u30a7\u30fc\u30f3\u3002\u6700\u8fd1\u3069\u3046\uff1f\u300d\u300c\u5225\u306b\u3002\u3042\u306a\u305f\u306f\uff1f\u300d\u300c\u30b8\u30a7\u30cb\u30d5\u30a1\u30fc\u3068\u7d50\u5a5a\u3057\u305f\u3093\u3060\u3002\u300d\u300c\u3048\u3048\u3063\u3001\u304a\u3081\u3067\u3068\u3046\uff01\u300d", en: '541 "Hi, Jane. What\'s up?" "Not much. How about you?" "I got married to Jennifer." "Wow! Congratulations!"'}, B.List_jp_en, type$.ConstantStringMap_String_String);
    B.Map_Xpwu8 = new A.ConstantStringMap(2, {jp: "542 \u5927\u5909\u306a\u3053\u3068\u304c\u3042\u3063\u305f\u308a\u3001\u843d\u3061\u8fbc\u3093\u3060\u308a\u3057\u305f\u3068\u304d\u306f\u3044\u3064\u3067\u3082\u3001\u79c1\u304c\u3042\u306a\u305f\u306e\u305d\u3070\u306b\u3044\u308b\u308f\u3002", en: "542 Whenever you're in trouble or feeling down, I'll be there for you."}, B.List_jp_en, type$.ConstantStringMap_String_String);
